import React from 'react'
import { useSelector } from 'react-redux';
import ProductCard from '../ProductCard/ProductCard';
import wishlist from '../../assets/wishlist.avif'
import Banner from '../ReusableElements/Banner/Banner';


export default function Wishlist() {
  const wishProducts = useSelector(state => state.wishlist)

  return (
    <Banner>
        <div className='cards_container' style={{background: 'transparent'}}>
            {
                !wishProducts.length ? 
                <p className='h4'>When you see something you like, click on the heart and we will save it here</p> :
                wishProducts.map(el => <ProductCard key={el.id} {...el}/>)
            }
        </div>        
    </Banner>
  )
}
